import { Box } from "@mui/material";

const ProfileCard = ({text}) => {
    return (
        <>
            <Box
                sx={{
                    width:303,
                    height:395,
                    backgroundColor: "F8F9FC",
                    borderRadius: 10,
                    px: 3,
                    py: 2,
                    fontStyle: "Inter",
                    fontSize: 22,
                    textTransform: "none",
                    border:"1px solid black",
                    '&:hover': {
                        backgroundColor: 'black',
                        color: 'white',
                    }
                }}
                >
                Learn more
            </Box>
        </>
    );
};

export default ProfileCard;
